import "./App.css";
import * as dfd from "danfojs";

function App() {
  const df = async () => {
    try {
      await dfd.readCSV(
        "/Users/omarbailey/Documents/Gym/Omar Random Workout Generator.csv"
      );
    } catch (err) {
      console.log(err);
    }
  };

  df.head().print();

  return (
    <div>
      <h1> Workout Generator</h1>
    </div>
  );
}

export default App;
